class MysqlOperations {
    static async insert(connection, tableName, columns, data) {
        let columnsStr = '';

        columns.forEach(column => columnsStr += `${column},`)

        return new Promise((resolve, reject) => {
            connection.query(`INSERT INTO ?? (${columnsStr.slice(0, -1)}) VALUES ?;`, [tableName, data], err => {
                if (err) reject(err);
                resolve();
            })
        })
    }

    static async update(connection, tableName, column, newValue, conditionColumn, conditionValue) {
        return new Promise((resolve, reject) => {
            connection.query(`UPDATE ?? SET ?? = ? WHERE ?? = ?;`, [tableName, column, newValue, conditionColumn, conditionValue], err => {
                if (err) reject(err);
                resolve();
            })
        })
    }

    static async select(connection, tableName, conditionColumn, conditionValue) {
        return new Promise((resolve, reject) => {
            connection.query(`SELECT * FROM ?? WHERE ?? = ?;`, tableName.conditionColumn, conditionValue, (err, result) => {
                if (err) reject(err);
                resolve(result)
            })
        })
    }
}

