const connection = require('../database/mysql.js');
const mysqlOperations = require('../database/operations.js');

class OrderController {
    static async createOrder(req, res) {
        const { customerID, itemID, qty } = req.body;

        if (!customerID || !itemID || !qty) return res.status(400).send("Invalid request");

        try {
            const getCustomer = await mysqlOperations.insert(connection, 'Customer', ['id'], customerID);

            console.log(getCustomer)
        } catch (err) {
            console.log(`Failed to create Customer, err: ${err}`);
            return res.status(500).send("Interal server error");
        }
    }
}

module.exports = exports = OrderController;
